import { Squash as Hamburger } from "hamburger-react";

const Filter = () => {
  return (
    <>
      <div id="filter">
        <div id="filter-box" className="flex justify-end">
          <div id="filtered-element"></div>
          <div id="menu-button">
            <Hamburger rounded size={24} />
          </div>
        </div>
        <div id="filter-dropdown" className="flex justify-end">
          <div id="dropdown" className=" border-black border-2 rounded-md m-3">
            <div id="single-filter">
              <button>Bat</button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Filter;
